  [],\n\t\"revision_timestamp\": \"2015-05-06T22:07:59.954255\",\n\t\"name\": \"generic-isis-transport-module-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the Generic ISIS Transport
  Module is to provide a means to bring living specimens to and from orbit. In addition
  to living specimens, the module can be used to carry subpayloads that require precise
  environmental control or continuous data recording. In order to maximize the amount
  of science for a given mission, many biological experiments require initiation while
  still on the ground. In these types of experiments, it is imperative that the specimens
  are housed in a very precisely controlled and accurately quantified environment.
  The GITM has the ability to control temperature, humidity, light level, fluid level,
  air circulation and air exchange rate with cabin. Sensors and cameras continuously
  monitor the contents of the chamber and have the ability to record images. The module
  meets both the Single Middeck Locker interface as well as the ISIS 6 Panel Unit
  Interface. By meeting both interfaces, specimens within the module can be launched/returned
  with power on the Space Shuttle Middeck and transferred to the ISS where it interfaces
  with the Life Sciences Glovebox. Specimens can then be transferred to the long duration
  test facility for the remainder of the experiment without direct exposure to the
  crew.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
